import './home.css';
function Home() {
  return (
        <div className='left_hom'> 
          <h2 className='title'>الصراط</h2>
          <p className='hom_desc'>شبكة اسلامية تعنى بنشر حديث اهل البيت <br/>
            (صلوات الله وسلامه عليهم اجمعين)
          </p>
          <button className='btn_hom'>تصفح اخر الاحاديث المرفوعة</button>
        </div>
  );
}

export default Home
